import { __decorate } from "tslib";
import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from "@angular/common/http";
let AuthorizationService = class AuthorizationService {
    constructor(http) {
        this.http = http;
        this.API = 'http://localhost:8080';
    }
    login(loginData) {
        const authorizationData = 'Basic ' + btoa(loginData.username + ':' + loginData.password);
        const httpOptions = {
            headers: new HttpHeaders({
                'Authorization': authorizationData
            })
        };
        return this.http.post(this.API + '/api/v1/auth/login', loginData, httpOptions);
    }
    regsiter(loginData) {
        return this.http.post(this.API + '/api/v1/auth/register', loginData);
    }
};
AuthorizationService.ctorParameters = () => [
    { type: HttpClient }
];
